 function HeaderComponent (props) {
            return (
                    <Container fluid="md">
                    <Row style={{padding:"0px"}}> 
                        <img style={{width:"50px",height:"50px"}} src={logo_img}/>
                        <Col>
                            <p style={{fontFamily:"Muli",fontSize:"35px",fontWeight:"bold"}}>Enyo Frontend</p>
                        </Col>                        
                    </Row>
                    </Container>
            )
    }

export default HeaderComponent;
